export default {
  props: {
    value: {
      type: Array,
      default: () => []
    },
    selected: {
      type: Number
    },
    base: {
      default: ""
    }
  },
  methods: {
    formatURL(url) {
      return new URL(url).pathname
        .replace(this.base, "")
        .split("/")
        .filter(e => e)
        .join(" › ")
        .replace(".html", "");
    }
  }
};
